query:
fragment InvoiceErrorFragment on InvoiceError {
  code
  field
  __typename
}

fragment InvoiceFragment on Invoice {
  id
  number
  createdAt
  url
  status
  __typename
}

mutation InvoiceRequest($orderId: ID!) {
  invoiceRequest(orderId: $orderId) {
    errors: invoiceErrors {
      ...InvoiceErrorFragment
      __typename
    }
    invoice {
      ...InvoiceFragment
      __typename
    }
    order {
      id
      invoices {
        ...InvoiceFragment
        __typename
      }
      __typename
    }
    __typename
  }
}
